#!/usr/bin/env python3
dna_seq = ''
dna_set = set('')
nt_count = {}
for nt in dna_set:
	count = dna_seq.count(nt)
	nt_count[nt] = count
GC_content = (int(nt_count['G']) + int(nt_count['C']))/(int(nt_count['C'])+int(nt_count['G']) + int(nt_count['A']) + int(nt_count['T']))
print('nt count:', nt_count, 'GC count:', GC_content)

